import React from "react";
// components
import Navbar from "components/Navbars/MyNavbar.js";
import './auth.css'

export default function Auth() {
  return (
    <>
      <Navbar />
      <main>
        <section className="relative w-full h-full py-40 min-h-screen">

            <h1 className="text-6xl font-normal leading-normal mt-0 mb-2 text-teal-800">
            China Digital Media and Creativity Competition for College Students
            </h1>
            <iframe
          src="//player.bilibili.com/player.html?aid=52428099&bvid=BV1R4411a7Tp&cid=91755580&page=1" scrolling="no" border="0" frameborder="no" framespacing="0" allowfullscreen="true"> </iframe>

        </section>
      </main>
    </>
  );
}
